description:
Poirot investigates the murder of a shady American businessman stabbed in his compartment on the Orient Express when it is blocked by a blizzard in the Serbian mountains.

During his journey on the Orient Express, the famous Belgian detective Hercule Poirot is approached by ruthless American businessman Samuel Ratchett who offers him ten thousand dollars to watch his back, but Poirot refuses.

Poirot awakes the following morning to find the train stuck in a snowdrift and Ratchett dead in his compartment...

